  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kulm WMD
  outlines Refuge accomplishments during the 1988 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning,
  public participation, and compliance with environmental and cultural resource mandates.
  Refuge administration is outlined; information about personnel, youth programs,
  manpower programs, volunteer programs, funding, safety, and technical assistance
  is given. Habitat management is also covered; subjects include wetlands, forests,
  croplands, grasslands, grazing, haying, fire management, pest control, and WPA easements.
  The wildlife section of the report discusses endangered and threatened species,
  waterfowl, marsh birds and waterbirds, game mammals, wildlife propagation, scientific
  collections, animal control, and disease control. The public uses of the Refuge
  described in this report include outdoor classrooms, interpretive programs, hunting,
  trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  major maintenance, and equipment replacement. Cooperative programs and items of
  interest are provided at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
